"5. Protection of right to personal liberty":["(1) No person shall be deprived of his personal liberty save as may be authorised by lawâ€”", ["~(a) in consequence of his unfitness to plead to a criminal charge or in execution of the sentence or order of a Court, whether in Mauritius or elsewhere, in respect of a criminal offence of which he has been convicted;","(b) in execution of the order of a Court punishing him for contempt of that Court or of another Court;","(c) in execution of the order of a Court made to secure the fulfilment of any obligation imposed on him by law;","(d) for the purpose of bringing him before a Court in execution of the order of a Court;","(e) upon reasonable suspicion of his having committed, or beingabout to commit, a criminal offence;","(f) in the case of a person who has not attained the age of18 years, for the purpose of his education or welfare; ","(g) for the purpose of preventing the spread of an infectious or contagious disease;","(h) in the case of a person who is, or is reasonably suspected to be, of unsound mind or addicted to drugs or alcohol, for the purpose of his care or treatment or the protection of the community;","(i) for the purpose of preventing the unlawful entry of that person into Mauritius, or for the purpose of effecting the expulsion, extradition or other lawful removal of that person from Mauritius or the taking of proceedings relating thereto;","(j) upon reasonable suspicion of his being likely to commit breaches of the peace; or","(k) in execution of the order of the Commissioner of Police, upon reasonable suspicion of his having engaged in, or being about to engage in, activities likely to cause a serious threat to public safety or public order."],"(2) Any person who is arrested or detained shall be informed as soon as reasonably practicable, in a language that he understands, of the reasons for his arrest or detention and shall be permitted, at his own expense, to retain and instruct without delay a legal r